// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "./multisig.sol"; // Import the MultiSigWallet contract

/**
 * @title MultiSigWalletFactory
 * @dev Factory contract for creating and managing MultiSig wallet instances
 */
contract MultiSigWalletFactory {
    // Events
    event WalletCreated(
        address indexed walletAddress,
        address indexed creator,
        address[] owners,
        uint256 timestamp
    );
    event WalletRegistered(address indexed walletAddress, string name);

    // State variables
    address[] public deployedWallets;
    mapping(address => bool) public isDeployedWallet;
    mapping(address => address[]) public userWallets; // user => wallet addresses
    mapping(address => WalletInfo) public walletInfo;
    
    struct WalletInfo {
        string name;
        address creator;
        address[] owners;
        uint256 createdAt;
        bool isActive;
    }

    // Modifiers
    modifier onlyValidWallet(address _wallet) {
        require(isDeployedWallet[_wallet], "Wallet not deployed by this factory");
        _;
    }

    /**
     * @dev Create a new MultiSig wallet
     * @param _owners Array of owner addresses for the new wallet
     * @param _name Human-readable name for the wallet
     * @return walletAddress Address of the newly created wallet
     */
    function createWallet(
        address[] memory _owners,
        string memory _name
    ) external returns (address walletAddress) {
        require(_owners.length >= 3, "Minimum 3 owners required");
        require(bytes(_name).length > 0, "Wallet name cannot be empty");
        
        // Validate owners
        for (uint256 i = 0; i < _owners.length; i++) {
            require(_owners[i] != address(0), "Invalid owner address");
            
            // Check for duplicates
            for (uint256 j = i + 1; j < _owners.length; j++) {
                require(_owners[i] != _owners[j], "Duplicate owner address");
            }
        }

        // Deploy new MultiSigWallet
        MultiSigWallet newWallet = new MultiSigWallet(_owners);
        walletAddress = address(newWallet);

        // Register the wallet
        deployedWallets.push(walletAddress);
        isDeployedWallet[walletAddress] = true;

        // Store wallet information
        walletInfo[walletAddress] = WalletInfo({
            name: _name,
            creator: msg.sender,
            owners: _owners,
            createdAt: block.timestamp,
            isActive: true
        });

        // Add wallet to each owner's list
        for (uint256 i = 0; i < _owners.length; i++) {
            userWallets[_owners[i]].push(walletAddress);
        }

        emit WalletCreated(walletAddress, msg.sender, _owners, block.timestamp);
        emit WalletRegistered(walletAddress, _name);

        return walletAddress;
    }

    /**
     * @dev Create wallet with deterministic address using CREATE2
     * @param _owners Array of owner addresses
     * @param _name Wallet name
     * @param _salt Salt for deterministic address generation
     * @return walletAddress Predicted address of the wallet
     */
    function createWalletWithSalt(
        address[] memory _owners,
        string memory _name,
        bytes32 _salt
    ) external returns (address walletAddress) {
        require(_owners.length >= 3, "Minimum 3 owners required");
        require(bytes(_name).length > 0, "Wallet name cannot be empty");

        // Validate owners
        for (uint256 i = 0; i < _owners.length; i++) {
            require(_owners[i] != address(0), "Invalid owner address");
            for (uint256 j = i + 1; j < _owners.length; j++) {
                require(_owners[i] != _owners[j], "Duplicate owner address");
            }
        }

        // Deploy using CREATE2
        bytes memory bytecode = abi.encodePacked(
            type(MultiSigWallet).creationCode,
            abi.encode(_owners)
        );
        
        assembly {
            walletAddress := create2(0, add(bytecode, 0x20), mload(bytecode), _salt)
        }
        
        require(walletAddress != address(0), "Failed to deploy wallet");

        // Register the wallet
        deployedWallets.push(walletAddress);
        isDeployedWallet[walletAddress] = true;

        // Store wallet information
        walletInfo[walletAddress] = WalletInfo({
            name: _name,
            creator: msg.sender,
            owners: _owners,
            createdAt: block.timestamp,
            isActive: true
        });

        // Add wallet to each owner's list
        for (uint256 i = 0; i < _owners.length; i++) {
            userWallets[_owners[i]].push(walletAddress);
        }

        emit WalletCreated(walletAddress, msg.sender, _owners, block.timestamp);
        emit WalletRegistered(walletAddress, _name);

        return walletAddress;
    }

    /**
     * @dev Predict wallet address for CREATE2 deployment
     * @param _owners Array of owner addresses
     * @param _salt Salt for address generation
     * @return predicted Predicted wallet address
     */
    function predictWalletAddress(
        address[] memory _owners,
        bytes32 _salt
    ) external view returns (address predicted) {
        bytes memory bytecode = abi.encodePacked(
            type(MultiSigWallet).creationCode,
            abi.encode(_owners)
        );
        
        bytes32 hash = keccak256(
            abi.encodePacked(
                bytes1(0xff),
                address(this),
                _salt,
                keccak256(bytecode)
            )
        );
        
        return address(uint160(uint256(hash)));
    }

    /**
     * @dev Update wallet name (only by original creator)
     * @param _wallet Wallet address
     * @param _newName New name for the wallet
     */
    function updateWalletName(
        address _wallet,
        string memory _newName
    ) external onlyValidWallet(_wallet) {
        require(
            walletInfo[_wallet].creator == msg.sender,
            "Only creator can update name"
        );
        require(bytes(_newName).length > 0, "Name cannot be empty");
        
        walletInfo[_wallet].name = _newName;
        emit WalletRegistered(_wallet, _newName);
    }

    /**
     * @dev Deactivate a wallet (mark as inactive)
     * @param _wallet Wallet address to deactivate
     */
    function deactivateWallet(address _wallet) external onlyValidWallet(_wallet) {
        require(
            walletInfo[_wallet].creator == msg.sender,
            "Only creator can deactivate"
        );
        walletInfo[_wallet].isActive = false;
    }

    /**
     * @dev Get all wallets deployed by this factory
     * @return Array of wallet addresses
     */
    function getDeployedWallets() external view returns (address[] memory) {
        return deployedWallets;
    }

    /**
     * @dev Get wallets owned by a specific user
     * @param _user User address
     * @return Array of wallet addresses where user is an owner
     */
    function getUserWallets(address _user) external view returns (address[] memory) {
        return userWallets[_user];
    }

    /**
     * @dev Get active wallets for a user
     * @param _user User address
     * @return activeWallets Array of active wallet addresses
     */
    function getActiveUserWallets(address _user) external view returns (address[] memory activeWallets) {
        address[] memory allWallets = userWallets[_user];
        uint256 activeCount = 0;
        
        // Count active wallets
        for (uint256 i = 0; i < allWallets.length; i++) {
            if (walletInfo[allWallets[i]].isActive) {
                activeCount++;
            }
        }
        
        // Create array of active wallets
        activeWallets = new address[](activeCount);
        uint256 index = 0;
        
        for (uint256 i = 0; i < allWallets.length; i++) {
            if (walletInfo[allWallets[i]].isActive) {
                activeWallets[index] = allWallets[i];
                index++;
            }
        }
        
        return activeWallets;
    }

    /**
     * @dev Get wallet information
     * @param _wallet Wallet address
     * @return info Wallet information struct
     */
    function getWalletInfo(address _wallet) external view returns (WalletInfo memory info) {
        require(isDeployedWallet[_wallet], "Wallet not found");
        return walletInfo[_wallet];
    }

    /**
     * @dev Get total number of deployed wallets
     * @return Total count of wallets
     */
    function getTotalWallets() external view returns (uint256) {
        return deployedWallets.length;
    }

    /**
     * @dev Get wallet details including current state
     * @param _wallet Wallet address
     * @return name Wallet name
     * @return creator Creator address
     * @return owners Array of owner addresses
     * @return balance Current wallet balance
     * @return transactionCount Number of transactions
     * @return isActive Whether wallet is active
     */
    function getWalletDetails(address _wallet)
        external
        view
        onlyValidWallet(_wallet)
        returns (
            string memory name,
            address creator,
            address[] memory owners,
            uint256 balance,
            uint256 transactionCount,
            bool isActive
        )
    {
        WalletInfo memory info = walletInfo[_wallet];
        MultiSigWallet wallet = MultiSigWallet(payable(_wallet));
        
        return (
            info.name,
            info.creator,
            info.owners,
            wallet.getBalance(),
            wallet.getTransactionCount(),
            info.isActive
        );
    }

    /**
     * @dev Check if an address is a wallet deployed by this factory
     * @param _wallet Address to check
     * @return True if wallet was deployed by this factory
     */
    function isFactoryWallet(address _wallet) external view returns (bool) {
        return isDeployedWallet[_wallet];
    }
}

contracts/Lock.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.28;

// Uncomment this line to use console.log
// import "hardhat/console.sol";

contract Lock {
    uint public unlockTime;
    address payable public owner;

    event Withdrawal(uint amount, uint when);

    constructor(uint _unlockTime) payable {
        require(
            block.timestamp < _unlockTime,
            "Unlock time should be in the future"
        );

        unlockTime = _unlockTime;
        owner = payable(msg.sender);
    }

    function withdraw() public {
        // Uncomment this line, and the import of "hardhat/console.sol", to print a log in your terminal
        // console.log("Unlock time is %o and block timestamp is %o", unlockTime, block.timestamp);

        require(block.timestamp >= unlockTime, "You can't withdraw yet");
        require(msg.sender == owner, "You aren't the owner");

        emit Withdrawal(address(this).balance, block.timestamp);

        owner.transfer(address(this).balance);
    }
}

